/*eslint-disable*/

import { useEffect } from "react";
import Col from "react-bootstrap/esm/Col";
import Row from "react-bootstrap/esm/Row";
import { Chart } from "react-google-charts";

function ShowChart(props) {
  const data = [["Name", "Number"]];

  let count = 0;
  for (let i in props.result) {
    if (count == 10) {
      break;
    }
    data.push(props.result[i]);
    count++;
  }

  const options = {
    title: "상위 10개 이름 통계",
    subtitle: "asdfasdffs",
    bar: { groupWidth: "80%" },
    legend: { position: "none" },
    colors: ["gray"],
    chartArea: {
      width: "80%",
      height: "80%",
      right: 10,
    },
    titleTextStyle: {
      fontSize: 24,
    },
    vAxis: {
      textStyle: {
        fontSize: 16,
      },
    },
    hAxis: {
      textStyle: {
        fontSize: 14,
      },
    },
  };
  const chart = (
    <Chart
      chartType="BarChart"
      width="600px"
      height="500px"
      data={data}
      options={options}
    />
  );

  //차트 만들기
  useEffect(() => {});

  const chartStyle = {
    backgroundColor: "brown",
  };

  return (
    <Row>
      <Col>
        <div style={chartStyle}>{chart}</div>
      </Col>
    </Row>
  );
}

export default ShowChart;
